import React from "react";
import ListItem from "./ListItem";

const List = ({todos,setTodo,getTodosByFilter}) =>{
    return(
        <ul>
            {

                getTodosByFilter.map(todo => <ListItem  setTodo={setTodo} todos={todos} todo={todo} id={todo.id} key={todo.id}/>)
            }
        </ul>
    )
}

export default  List;
